import time
class Solution:
    #利用滑动窗口思想，用前k项和进行+ nums[i] - nums[i - k]的平移，保持时间复杂度O(n)
    #也可以像第二种函数利用double型的sums，保持空间复杂度在O(1)
    def findMaxAverage(self, nums, k):
        sums = []
        sums.append(sum(nums[:k]))
        size = len(nums)
        for i in range(k, size):
            sums.append(sums[i - k] + nums[i] - nums[i - k])
        return max(sums) / k

    def findMaxAverage1(self, nums, k):
        sum = 0
        for i in range(k):
            sum += nums[i]
        res = sum
        for i in range(k, len(nums)):
            sum += (nums[i] - nums[i - k])
            res = max(res, sum)
        return res / k


